import React from 'react';
// import { fetchCitiesWithRedux } from "../actions/cityActions";
// import {connect} from 'react-redux';

class Filter extends React.Component {
    // componentDidMount(){
    //     this.props.dispatch(fetchCitiesWithRedux());
    // };

    handleChange = (e) => {
        this.setState({
            cityName: e.target.value
        });
        this.props.onChange(event.target.value)
    };

    render() {
        return (
            <div className="contain cityDisplay">
                <label htmlFor="searchText">Search</label><input id="searchText" type="text" value={this.props.cityName}
                                                                 onChange={this.handleChange}/>
            </div>
        )
    }
}


const mapStateToProps = state => ({
    ...state,
});

export default connect(mapStateToProps)(Filter)
